function turn(id, state) 
{
	if (state) document.getElementById(id).setAttribute('style', "");
	else document.getElementById(id).setAttribute('style', "visibility:hidden;");
}

function _switch(id)
{
	if(document.getElementById(id).getAttribute('style') == "") document.getElementById(id).setAttribute('style', "opacity:0%;");
	else document.getElementById(id).setAttribute('style', "");
}

